import './App.css';
import { useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState({username:'', password: '', role:''});
  const [home, setHome] = useState({username:'', password: '', role:''});

  async function handleClick(){
    fetch("/employees")
    .then((res) => res.json())
    .then((data) => {setHome({username: data.username, password: data.password, role: data.role})});
  }

  useEffect(() => {
    fetch("/studentLogin")
      .then((res) => res.json())
      .then((data) => {setData({username: data.username, password: data.password, role: data.role})});
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>UserName: {!data ? "Loading..." : data.username}</p>
        <p>Password: {!data ? "Loading..." : data.password}</p>
        <button onClick={handleClick}>Home page</button>
        {home ? home.role : "not lecturer"}
        {console.log(home.role)}
      </header>
    </div>
  );
}

export default App;
